"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2127:"一九七八年十二月，中共十一届三中全会召开，决定把党和国家的工作重点转移到经济建设上来，作出了改革开放的重大决策，实现了新中国成立以来党和国家历史的伟大转折，开创了社会主义事业发展的新时期一九八四年，“百万大裁军”战略宣布后，方邦彦、何有邻、康宁三人几乎同一时间从部队转业，分别进入外贸国企永江纺织厂、省计委以及乡集体服装厂，开始了各自的改革之路。彼时，改革风起云涌。在经历八六年“第一次价格闯关”失败后，方邦彦也遭遇了纺织厂改制困境并被迫离开。随着改革的春风再起以及“九二南巡讲话”的发表，方邦彦又看到了新的希望。他与有志青年林云借风创业，走在了互联网大军的第一列。在国家理顺了价格体系并且“第二次价格闯关”成功后，方邦彦不忘初心，毅然回到纺织厂，带领大家积极参与国际竞争，使濒临倒闭的外贸国企扭亏为盈。进入新世纪后，中国重新开启“入世谈判”，方邦彦抓住机遇，在国家政策的支持下完成了自己当年纺织厂的改制梦想，突破重重关卡，实现了国企的现代化企业制度的转型成功上市迈进世界五百强，并且一鼓作气完成海外并购。与此同时，他的老对手也是大舅哥的战友何有邻也渐渐地在改革的浪潮中从墨守成规，拘泥于体制开始解放思想，积极帮助企业改制，并且将全能型政府职能转变为服务型职能；而他的老部下康宁在搞活集体企业的同时却在利益驱动之下将企业据为己有，并利用收购纺织厂生产线来进行走私犯罪，甚至不惜嫁祸昔日部队领导方邦彦，最终锒铛入狱。出狱后，康宁流落中东，并被黑道追杀，最后被自己恨之入骨的方邦彦救回，羞愧难当，在方邦彦与何有邻的帮助下重新开始新的生活。“一带一路”的战略发布后，三个已近耳顺之年的兄弟，举杯展望，风再起时，再度扬帆远航。";s:13:"vod_play_from";s:48:"dbm3u8$$$gqm3u8$$$zuidam3u8$$$172m3u8$$$subom3u8";s:15:"vod_play_server";s:22:"no$$$no$$$no$$$no$$$no";s:13:"vod_play_note";s:12:"$$$$$$$$$$$$";s:12:"vod_play_url";s:16015:"01$https://doubanzyv3.tyswmp.com:888/2018/11/06/JlulC1QYLaTzGPzE/playlist.m3u8#02$https://doubanzyv3.tyswmp.com:888/2018/11/06/3soWJwEOVSosdkLj/playlist.m3u8#03$https://doubanzyv3.tyswmp.com:888/2018/11/07/t0YFAGCLZThP1er6/playlist.m3u8#04$https://doubanzyv3.tyswmp.com:888/2018/11/07/B22UyUdjp2fXOEx6/playlist.m3u8#05$https://doubanzyv3.tyswmp.com:888/2018/11/08/FaQOgGDoa028khGy/playlist.m3u8#06$https://doubanzyv3.tyswmp.com:888/2018/11/08/NRACORQEOmMFFK5Q/playlist.m3u8#07$https://doubanzyv3.tyswmp.com:888/2018/11/09/Dba8Yr8SatKPVqBe/playlist.m3u8#08$https://doubanzyv3.tyswmp.com:888/2018/11/09/J5evBSS3t1eGhH79/playlist.m3u8#09$https://doubanzyv3.tyswmp.com:888/2018/11/10/3Tzs2zdvUoLFzP9n/playlist.m3u8#10$https://doubanzyv3.tyswmp.com:888/2018/11/11/bzszjn15imgb1kU0/playlist.m3u8#11$https://doubanzyv3.tyswmp.com:888/2018/11/12/ytcWUE99PkIsTHui/playlist.m3u8#12$https://doubanzyv3.tyswmp.com:888/2018/11/12/MOOgQYO2UUtfpwKX/playlist.m3u8#13$https://doubanzyv3.